import React from "react";
import { Box, Text, Image, MenuItem, Stack, Link } from "@chakra-ui/react";

export default function Logo(props) {
  return (
    <Box {...props}>
        <Stack direction="row">
            <Image src="/zen_mastercard_logo-2.svg" /> 
            <Link>Personal</Link>
            <Link>Business</Link>
        </Stack>
    </Box>
  );
}
